import React, { useState } from "react";
import "./styles/Signup.css";
import { useNavigate } from "react-router-dom";
import Navbar from "../Components/Navbar";
import Footer from "../Components/Footer";

function Signup({ isSignedIn, setIsSignedIn }) {
	const [firstName, setFirstName] = useState("");
	const [lastName, setLastName] = useState("");
	const [email, setEmail] = useState("");
	const [interests, setInterests] = useState("");
	const [contentSources, setContentSources] = useState("");
	const [personality, setPersonality] = useState("");
	const [digestName, setDigestName] = useState("");
	const navigate = useNavigate();

	const handleFirstNameChange = (e) => {
		setFirstName(e.target.value);
	};

	const handleLastNameChange = (e) => {
		setLastName(e.target.value);
	};

	const handleEmailChange = (e) => {
		setEmail(e.target.value);
	};

	const handleInterestsChange = (e) => {
		setInterests(e.target.value);
	};

	const handleContentSourcesChange = (e) => {
		setContentSources(e.target.value);
	};

	const handlePersonalityChange = (e) => {
		setPersonality(e.target.value);
	};

	const handleDigestNameChange = (e) => {
		setDigestName(e.target.value);
	};

	if (isSignedIn) {
		navigate("/main");
	}

	const handleSubmit = (event) => {
		event.preventDefault();

		const formData = {
			firstName,
			lastName,
			email,
			interests: interests.split(",").map((interest) => interest.trim()),
			contentSources: contentSources
				.split(",")
				.map((interest) => interest.trim()),
			personality: personality,
			digestName: digestName,
		};

		// Send the form data to the server for further processing
		console.log(formData);
		setIsSignedIn(true);
	};

	return (
		<div>
			<Navbar backgroundColor={"#43372e"} />
			<div className="signup">
				<div className="form-container">
					<p className="already-signed-in">
						Already have an account? <a href="sign-in.html">Sign in</a>
					</p>
					<form className="signup-form" onSubmit={handleSubmit}>
						<h1>User</h1>
						<div className="name-wrapper">
							<input
								type="text"
								placeholder="First Name*"
								name="firstName"
								value={firstName}
								onChange={handleFirstNameChange}
								required
							/>
							<input
								type="text"
								placeholder="Last Name*"
								name="lastName"
								value={lastName}
								onChange={handleLastNameChange}
								required
							/>
						</div>
						<label>Email*</label>
						<input
							type="text"
							placeholder="Email"
							name="email"
							value={email}
							onChange={handleEmailChange}
							required
						/>
						<h1>Personalization</h1>
						<label>Interests*</label>
						<textarea
							placeholder="Tech updates, finance news, formula one..."
							name="interests"
							value={interests}
							onChange={handleInterestsChange}
							style={{ height: "200px" }}
							required
						></textarea>

						<label>Content Sources*</label>
						<textarea
							placeholder="nytimes.com, politico.com..."
							name="contentSources"
							value={contentSources}
							onChange={handleContentSourcesChange}
							style={{ height: "200px" }}
							required
						></textarea>

						<label>Daily Digest Personality</label>
						<input
							type="text"
							placeholder="funny and humorous"
							name="personality"
							value={personality}
							onChange={handlePersonalityChange}
						/>
						<div className="button-wrapper">
							<input type="submit" value="Sign Up" />
						</div>

						<label>Digest Name</label>
						<input
							type="text"
							placeholder="Alex's Digest"
							name="digestName"
							value={digestName}
							onChange={handleDigestNameChange}
						/>
						<div className="button-wrapper">
							<input type="submit" value="Sign Up" />
						</div>
					</form>
				</div>
			</div>
			<Footer backgroundColor={"#43372e"} />
		</div>
	);
}

export default Signup;
